Df = pd.read_excel('情绪指数.xlsx',sheetname='全市场')
Df.set_index('日期',inplace=True)
Df.replace('--',np.nan,inplace=True)
Df = Df.astype('float')
Df['MEAN'] = Df.mean(axis=1)



# 计算macd
def cal_macd_system(data,short_,long_,m):
    '''
    data是包含高开低收成交量的标准dataframe
    short_,long_,m分别是macd的三个参数
    返回值是包含原始数据和diff,dea,macd三个列的dataframe
    '''
    data['diff']=data['MEAN'].ewm(adjust=False,alpha=2/(short_+1),ignore_na=True).mean()-\
                data['MEAN'].ewm(adjust=False,alpha=2/(long_+1),ignore_na=True).mean()
    data['dea']=data['diff'].ewm(adjust=False,alpha=2/(m+1),ignore_na=True).mean()
    data['macd']=2*(data['diff']-data['dea'])
    return data

cal_macd_system(Df,12,26,9)


